import './checkout-cart.style.css'
import React from 'react';

const CheckoutCart = ({cart}) => {
    return (
        <div className='checkoutCart'>
            <img className='img' src={cart.imageUrl}/>

        </div>
    );
}

export default CheckoutCart;
